import React from "react";
import "./addtaskcard.css";

function AddTaskCard() {
    return (
        <div className="card col-3">
            <div className="card-body">
                <a href="#" className="btn btn-primary">
                    ADD TASK
                </a>
            </div>
        </div>
    );
}

export default AddTaskCard;
